import { Fragment } from "react";
import StepField from "./StepField";
export default (props) => {
    return <Fragment>
        <h1>{props.q.title}</h1>
        <h2>{props.q.subtitle}</h2>
        <form>
            {props.q.fields.map(field => <StepField onUpdate={props.onUpdate} onNavigate={props.onNavigate} field={field} />)}
        </form>
    </Fragment>
}
